import Vue from 'vue'
import VueRouter from 'vue-router'
import Login from '../pages/Login'

Vue.use(VueRouter)
export default new VueRouter({
    routes: [{
            path: '/',
            name: 'Login',
            component: Login
        },
        {
            path: '/index',
            name: 'index',
            component: () => import('../pages/Index.vue'),
            children: [{
                    path: '/index/home',
                    name: 'Home',
                    component: () => import('../pages/index/Home.vue'),
                },
                {
                    // 订单管理
                    path: '/index/order',
                    name: 'Order',
                    component: () => import('../pages/index/Order.vue'),
                },

                {
                    // 商品列表
                    path: '/index/list',
                    name: 'Product',
                    component: () => import('../pages/index/Product.vue'),
                },
                {
                    // 添加商品
                    path: '/index/goodsAdd',
                    name: 'GoodsAdduct',
                    component: () => import('../pages/index/AddMerchandise.vue'),
                },
                {
                    // 商品分类
                    path: '/index/classify',
                    name: 'Classify',
                    component: () => import('../pages/index/Classify.vue'),
                },
                {
                    // 店铺管理
                    path: '/index/shops',
                    name: 'Shops',
                    component: () => import('../pages/index/Shops.vue'),
                },
                {
                    // 账号列表
                    path: '/index/accountlist',
                    name: 'accountlist',
                    component: () => import('../pages/index/AccountList.vue'),
                },
                {
                    // 添加账户
                    path: '/index/addaccount',
                    name: 'addaccount',
                    component: () => import('../pages/index/AddAccount.vue'),
                },
                {
                    // 修改密码
                    path: '/index/change',
                    name: 'change',
                    component: () => import('../pages/index/Change.vue'),
                },
                {
                    // 商品统计
                    path: '/index/commodity',
                    name: 'commodity',
                    component: () => import('../pages/index/Commodity.vue'),
                },
                {
                    // 订单统计
                    path: '/index/indent',
                    name: 'indent',
                    component: () => import('../pages/index/Indent.vue'),
                },
            ]
        }
    ]
})
